      "description": "<p><i>First Degree</i></p> <p><i>January 10, 2016 ¬†</i>Introduction to Wicca</p> <p>1st¬† Day of Registration 12:30pm¬†</p> <p>o ¬† What is Wicca? What is a Witch?¬†</p> <p>o ¬† Herstory History ¬†on Pagan Religions of The Old Ways</p> <p>o ¬† Early Christianity and Paganism¬†</p> <p>o ¬† Druids / Celts¬†</p> <p>o ¬† Romans, Greek¬†</p> <p>o ¬† Egyptian paganism¬†</p> <p>o ¬† What it means to us today</p> <p>$30 in person/$33 via paypal¬†- PLEASE bring your receipt to class.</p> <p><br/>Academy of Pagan Studies offers the most comprehensive, well-planned and affordable training available anywhere. We have a very interactive community based program. We provide many sources of learning that go into each and every class, which surpasses others when learning about Wicca / WitchCraft in New York City. We offer First through Third Degree training. Additionally we have many other Witch Crafting Classes &amp; Workshops including: Herbal Intensive Series, Starlight Vision Series and much more, such as tarot, pendulum use, candle craft, magickal herbs, spell craft, runes etc.</p> <p>What is wonderfully unique about WFT Academy of Pagan Studies is that it allows you to set the pace of your learning experience and provides you with an affordable way to grow within a structured Wiccan learning environment. You will be challenged and we do invite those who welcome this challenge to our Academy. We take your education very seriously, and in turn you should be serious about your education and training in the Path of Wicca / WitchCraft. Before considering enrollment and training at WFT Academy of Pagan Studies keep in mind that it is a life-path commitment.</p> <p>Within our Academy there is an enormous amount of Community Interaction through the use of meetups, and now our newly formed private FB group just for our students to converse, further enabling you to increase your knowledge and learning as well as providing you the ability to network with other like-minded individuals in a safe and supportive environment.</p> <p>The Academy is truly a Spiritual Home and we welcome you to make it your own!</p> <p>We have Degree-specific Study to discuss challenging lessons, facilitate rituals celebrating the Sabbats and Esbats as well as for healing and self-empowerment, all in a friendly and open atmosphere. We also hold Degree dedications marking the stages of your training as you move through the Academy*. We have found that many of our Students find it wonderful to be in a group learning environment that they can consider a Community Home.</p> <p>We are all very proud of our Academy and what we have accomplished so far. But ever mindful that it is each and every one of the Students that make it what it is. If you are reading this, we are confident that you would make a wonderful addition to our Circle and do hope that after reading you will decide to join us as a Academy Student and member of The NYC Wiccan Family Temple.</p> <p>We strive to provide a comprehensive selection of training programs and as such offers many other Elective Craft courses and training opportunities for seekers of knowledge and magickal expertise. We encourage you to visit our CURRICULUM PAGE &amp; CRAFT CLASSES PAGE for a complete list of current and future programs.</p> <p>We welcome you to begin your studies by going to our ADMISSION AND PRICES (where you will find applications) page and submit your enrollment to the Academy today. We look forward to having you join us as a new Student of the WFT Academy of Pagan Studies.</p> <p>WE ARE ALWAYS IMPROVING UPON WHAT WE OFFER STRIVING AND PROMISING TO ALWAYS KEEP RAISING THE BAR ON WHAT WE OFFER.</p> <p>WE ARE THE MOST COMPREHENSIVELY TAUGHT WITCHCRAFT ACADEMY WITHIN THE NEW YORK CITY AREA.</p> <p>IF YOU WOULD LIKE TO FIND OUT FURTHER INFORMATION REGARDING THESE CLASSES, PLEASE GO TO¬†<a href=\"http://www.freewebs.com/wftacademyofpaganstudies.\">www.wftacademyofpaganstudies.</a>org¬†YOU WILL FIND REGISTRATION INFORMATION, PRICES AND OUR FULL CURRICULLUM. YOU CAN JOIN IN THESE CLASSES AT ANY TIME, AND CATCH UP WITH THE CLASSES YOU MISSED NEXT TIME IT COMES AROUND.</p> <p>IF YOU HAVE NOT DONE SO, PLEASE DO BRING YOUR APPLICATION FILLED OUT WITH YOU WHEN YOU COME TO CLASS. ALSO, BRING A NOTE BOOK AND PEN OR PENCIL.</p> <p>There is a one time fee per year of $25.00 registration fee.</p> <p>If you pay online please bring a receipt of payment as we do not always have time to check paypal the day of the class, or we will expect you pay at the class or gathering.</p> <p>FOR MORE INFORMATION ON CLASSES, EVENTS ETC. PLEASE VISIT US AT:¬†<br/><a href=\"http://www.wftacademyofpaganstudies.webs.com/\">www.wftacademyofpaganstudies.</a>org<br/><a href=\"http://www.wiccanfamilytemple.org/\">www.wiccanfamilytemple.org</a>¬†<br/><a href=\"http://www.thenycpagancouncil.webs.com/\">www.thenycpagancouncil.webs.com</a>¬†<br/><a href=\"http://www.romanctichandfastings.webs.com/\">www.romanctichandfastings.webs.com</a>¬†<br/><a href=\"http://www.charmedbystarr.com/\">www.charmedbystarr.com</a>¬†for all your ritual and pagan items.</p> ",
