      "link": "https://www.dev.meetup.com/NYC-International-Adventure-Travel-Club/events/234255833/",
      "description": "<p><img src=\"http://photos3.meetupstatic.com/photos/event/1/4/1/b/600_454325147.jpeg\" /></p> <p><b>NEPAL: Mt Everest Base Camp Trek ‚Äì 17 Days</b></p> <p><b><a href=\"http://www.gectravel.com/details.php?record=1175\">CLICK HERE</a> to book your spot.</b></p> <p>The group will travel <b>May 15 - 31, 2017</b>.</p> <p>Follow in the footsteps of the great explorers of Mt. Everest and visit the most famous of exploration base camps. Walk amongst the giants of the Himalaya on this <a href=\"http://www.gectravel.com/details.php?record=1175\">17 day classic trek</a> through the amazing and dramatically beautiful Khumbu Icefalls Valley and view the majesty of Mt. Everest up close.</p> <p>-----------------------------------------------------------------</p> <p><b>Pricing and Booking:</b></p> <p>STARTING PRICE: $1,799 (airfare additional)</p> <p><a href=\"http://www.gectravel.com/details.php?record=1175\">CLICK HERE</a> to book your spot.</p> <p>NOTE: a meetup RSVP does NOT reserve your space. For prices, details and to book your space on this tour, please <a href=\"http://www.gectravel.com/details.php?record=1213\">CLICK HERE</a></p> <p>-----------------------------------------------------------------¬†</p> <p><b>PLEASE NOTE: </b>These small group trips are open for anyone to join. You can sign up as a solo traveler (roommate matching is free - or you can get your own room) OR join with a spouse, friends or other family members. All are welcome!</p> <p><b>GET THE SCOOP!</b> Want to see what other club members are saying? Then check out the <a href=\"http://www.gectravel.com/testimonials.php\">GEC Testimonial Page</a>.</p> <p>-----------------------------------------------------------------¬†</p> <p>Included in the awesome adventure:<br/>* Small Group 17 day trekking tour to Mt. Everest Base Camp and Kala Patthar<br/>* Local Sherpa Guide<br/>* Sherpa Porters to carry your bag<br/>* All meals while trekking<br/>* Breakfast in Kathmandu<br/>* Airport transfers for domestic Lukla flights<br/>* 3 nights twin share in 3 star hotel in Kathmandu &amp; 13 nights in Himalayan tea houses/guesthouses</p> <p>Need help booking your airfare?¬† Just email me or give me a call at[masked]</p> <p><b><a href=\"http://www.gectravel.com/details.php?record=1175\">Click Here For Complete Details and Booking.</a></b></p> <p>Places Visited: Group trip to Mt. Everest Base Camp trek, Namche Bazaar, Kala Patthar, Lukla, Kathmandu, Nepal, Mt. Everest group trek</p> <p><b>----------------------------------------------------------------</b></p> <p>The <a href=\"http://www.gectravel.com/\">Global Expeditions Club</a> (GEC) is a group of fun-loving travelers looking for other like-minded people to travel the world with.¬† The travel club started 8 years ago with just a handful of meetup members, but has grown into one of the largest travel clubs in the world.</p> <p>Check out the <a href=\"http://www.gectravel.com/testimonials.php\">Global Expeditions Club's Testimonial Page</a> to see what others are saying about these trips.</p> <p>Of course, if you have any questions you can always contact me or one of the other organizers through meetup message or via phone at (617)[masked]<br/><b><br/>Make Friends. Travel the World.</b></p> ",
