      "description": "<p><img src=\"https://a248.e.akamai.net/secure.meetupstatic.com/photos/event/e/4/8/6/600_453358502.jpeg\" /></p> <p><b>Morocco 4WD Sahara Desert &amp; Atlas Mountains Off-Road Trip </b></p> <p>Get ready for an adventure of a lifetime among Morocco‚Äôs scenic mountains and vast desert as we explore Morocco ‚Äòoff the beaten path‚Äô as we make our way through the Atlas mountains by 4 wheel drive.</p> <p>Bask in the luxury of the Valley of the Roses while in full bloom during the annual Rose Festival and visit a factory to learn about the famed rosewater in the area.¬†Explore the chaotic souks and get lost in the colors and smells of the enchanting maze-like markets. ¬†Visit amazing communes that are carved into the sides of mountains and cliffs. Spend the night in a luxury desert camp on one of the largest dunes in the Sahara Desert. The adventures don‚Äôt stop there! Join us on this fantastic journey to discover the best of Morocco.¬†</p> <p><img src=\"https://a248.e.akamai.net/secure.meetupstatic.com/photos/event/e/4/9/e/600_453358526.jpeg\" /></p> <p><b>10-day/9-night tour --- May 7 - 16, 2017 </b></p> <p>Yelp Reviews :<a href=\"http://www.yelp.com/biz/globe-drifters-san-francisco\"> <a href=\"http://www.yelp.com/biz/globe-drifters-san-francisco\" class=\"linkified\">http://www.yelp.com/biz/globe-drifters-san-francisco</a></a></p> <p><b>Trip price : $2300<br/>Single supplement : $450 </b></p> <p>If you would like to be paired up with someone of the same gender on the trip to avoid paying the single supplement we can arrange for you. If there is nobody to pair up with you¬†WILL¬†have to pay the single supplement. Pairing with another person of the same gender comes on a first come, first serve basis.¬†After you reserve your spot we will send you a questionnaire pertaining to this and please return to us immediately so we can try our best to accommodate your needs.</p> <p>If you want¬†a single room throughout the tour, you can buy the ‚Äúsingle supplement‚Äú. The single supplement fee for this trip is $450. If you would like your own room you can buy the additional supplement at check-out.</p> <p><img src=\"https://a248.e.akamai.net/secure.meetupstatic.com/photos/event/e/4/b/0/600_453358544.jpeg\" /></p> <p><b>Included : </b><br/>- 9 nights accommodation<br/>- Ground transportation<br/>- Local guide + Professional driver<br/>- Activities and excursions as indicated<br/>- All breakfasts, 7 lunches, 7 dinners</p> <p><b>Not included : </b><br/>- Optional excursions and activities<br/>- 3 lunches, 3 dinners<br/>- Beverages<br/>- Gratuities<br/>- International flight<br/>- Insurance</p> <p>For more information, please visit : <a href=\"http://globe-drifters.com/tour/morocco-atlas-sahara-4wd/\"><a href=\"http://globe-drifters.com/tour/morocco-atlas-sahara-4wd/\" class=\"linkified\">http://globe-drifters.com/tour/morocco-atlas-sahara-4wd/</a></a> or email us at [masked]</p> <p>Feel free to post comments and/or questions below! :)¬†</p> <p><b><img src=\"https://a248.e.akamai.net/secure.meetupstatic.com/photos/event/e/3/7/9/600_453358233.jpeg\" /></b></p> ",
