      "link": "https://www.dev.meetup.com/cfinyc/events/234550554/",
      "description": "<p><b>Who are we?</b></p> <p>We are Muslims of varying degrees of religiousness:<br/>Some of us are practicing Muslims who simply want to take a more objective look at out teachings.<br/>Some of us want to discuss certain tenets of our faith that don‚Äôt sit well with us.<br/>Some of us have come to the realization that organized religion isn‚Äôt for us and want to discuss why.</p> <p><b>What do we want?</b></p> <p>We want to find the truth, no matter what it is, and fight for our right to follow it.<br/>We want to create a safe place for people to exchange thoughts and ideas that we were taught not to talk about.We want to support each other and help each other deal with family questions and formulate answers.<br/>We want to give others the chance to choose what they want for themselves, without fear of death, imprisonment, or persecution.</p> <p><b>Is it safe to attend?</b></p> <p>We will invite people to our meetings publicly but the meeting location will only be known to people who have attended a meeting in the past. So there are only two ways for a new member, or observer, to attend the meeting.<br/>1- By coming with an existing member.<br/>2- By replying to one of the ads and the volunteer group leader, Ibrahim, will personally talk to them to make sure they are either Muslim-ish or moderate enough Muslims that they would not harm members or reveal their identity. Please send inquiries to [masked]</p> <p><br/>And as this group is still in its infancy, we would like to keep it limited to people from Muslim backgrounds, as this will help us talk freely and comfortably knowing that we all come from the same place.</p> <p><br/>We will be meeting every two weeks, on Wednesdays, at 7PM, somewhere in Manhattan.</p> ",
