      "description": "<p>See updated Team Roster at the bottom of description</p> <p>‚Ä¢¬†¬†<b>ABSOLUTELY NO CLEATS ALLOWED! NO EXCEPTIONS!!</b></p> <p>‚Ä¢¬†WHAT COLOR SHIRT?¬†CHOOSE ONE OF THESE AND Answer the question when you sign up. Look at the comments as we will announce when a color is full.¬†</p> <p>‚Ä¢ Yellow, Blue (not navy), Pink, White, Black, Green</p> <p>‚Ä¢¬†We play rain or shine!</p> <p>‚Ä¢ Sign up as a team or a free agent.¬†</p> <p>‚Ä¢¬†PLEASE ARRIVE 15 Minutes Early - 9:45AM!! First¬†Game starts at 10am sharp .</p> <p>‚Ä¢ Round Robin - 5 x 20 minute Games Guaranteed.¬†</p> <p>‚Ä¢ Winners Get PS2G Surprises.¬†</p> <p>‚Ä¢ Big Goals 7v7 with 3 subs (every 5 minutes)¬†</p> <p>Rules explained at the game.</p> <p>Be Positive -¬†Constructive criticism after the game is way better than you yelling at me and complaining during the game.¬†</p> <p>Be Safe¬†-¬†Want to kick someone really hard? go take jiujitsu. We like our shins.</p> <p>Be 2¬†-¬†Teamwork. It takes 2 to complete every pass.</p> <p>Be Generous! -¬†Not just your money (though it helps). We want clapping and good cheers.¬†</p> <p><img src=\"http://photos2.meetupstatic.com/photos/event/5/e/d/0/600_258204272.jpeg\" /></p> <p>\n\n\n<i>All RSVPs are final. No credits or refunds. (It's all for charity anyway)</i></p> <p><i>If the game is cancelled, get a refund by filling out¬†<a href=\"http://www.playsoccer2give.com/games/refund-request\">this form.</a></i></p> <p><i>If you can't afford the meetup fees, please visit our website to learn how to become a game leader. Game Leaders play for free.¬†<a href=\"http://ps2g.org/gameleaders\"><a href=\"http://ps2g.org/gameleaders\" class=\"linkified\">http://ps2g.org/gameleaders</a></a></i></p> <p><i>PS2G raises money for charities that use soccer for social good restoring dignity where it's been lost through the game of soccer. We share the impact of this movement through multiple channels and promote generosity on the field through safe and supportive play.¬†</i></p> <p><i>PS2G - Local Game. Global Change.¬†</i></p> <p><i>Disclaimer By taking part in group activities you hereby are agreeing to the rules and regulation of the meetup. In addition, you acknowledge you are volunteering to play at your own self will and at your own risk. Neither organizer nor assistant organizers are responsible for any injuries or mishaps while partaking in the games. We encourage love of the game and for each other. We encourage friendly competition. Organizers reserve the right to remove players from the game if they refuse to be friendly.</i></p> <p><i>(Leader/Volunteer) - Chris W: [masked])¬†</i></p> <p><i>(Leader/Volunteer) - Adrian W: [masked])</i></p> <p><i>questions? Ask in comments or email [masked]</i></p> <p><i><b>Yellow Team: ¬†</b></i>Nick Gore, Zach T, Frank S, JasonLim, JasonLim +1, JasonLim +2, Ryan Q¬†</p> <p><b>White Team:¬†</b>Greg Wall,¬†Derek McKechnie, Tashi,¬†Martin Doykin, Amaury Moulron , Alan,¬†David Toro, Michael Slabitcher¬†</p> <p><b>Black Team:¬†</b>Kees Bakker,¬†Rodrigo Ceciliano,¬†Rodrigo Ceciliano +1 - Bernadoy Lion, Obi Aquino,¬†Maurycy Banaszek,¬†Nicholas Murphy,¬†Dushant Naniani,Mingi Kim</p> <p><b>Blue Team (Not dark blue):¬†</b>Viet,¬†Viet +1 - Ardavan,¬†Marcelo,¬†Xavier,¬†Xavier + 1-Johnny,¬†Andres E Salgado,¬†Billy,¬†Billy +1 - Cristopher Santana¬†</p> <p><br/><b>Green Team:¬†</b>Fritz Riha,¬†Samson M,¬†Samson M +1 - Miguel, Adam Bierman,¬†Llewyn Shin,¬†Llewyn Shin +1 - Gil,¬†Ismail Noursabah,¬†Ismail Noursabah +1 - Imad Bel Wa Sebastian, Bryan Rountree,¬†Sean¬†</p> <p><b>Red Team:¬†</b>David M.,¬†David M. + 1 - Hans M,¬†Byron Romero,¬†Byron Romero +1 - Francisco Lopez, Byron Romero +2 - Javier S,¬†Jorge diaz,¬†Jorge diaz +1 - Marco Capocannoniere, Jorge diaz +2 - Willian D√É-az¬†</p> ",
