      "description": "<p><b>****READ THIS FIRST ||¬†<a href=\"http://www.meetup.com/BklynPickupSoccer/messages/boards/thread/49437931\">Parade Grounds Game Standards</a>¬†****</b></p> <p><img src=\"http://photos1.meetupstatic.com/photos/event/d/6/b/600_444963435.jpeg\" /></p> <p><b>Meet on field 8!!!</b></p> <p><b><img src=\"http://photos2.meetupstatic.com/photos/event/a/9/c/7/600_453283463.jpeg\" /></b></p> <p>The game is scheduled to start at 4:00. Your RSVP is good if you come on time. If you come after teams are divided then you run the risk of not playing. Those who have RSVP‚Äôed get first preference to play (This does not apply to anyone on the waiting list). Also, please ¬†Un-RSVP if you will not be attending. That gives other people a chance to play.</p> <p><b>Rules and guidelines:</b></p> <p>These games are geared towards advanced to intermediate players.</p> <p>Teams are divided by two team captains (captains pick players in turns in an attempt to keep teams balanced and competitive)</p> <p>Physical play is allowed as long as it isn't overly aggressive or dirty.</p> <p>Slide tackles are allowed only to block a shot on goal or to intercept a pass ¬†NO slide tackling on a player with the ball.</p> <p>Ball hogging¬†is absolutely not tolerated¬†</p> <p><i><b>Keep in mind as we don't have permit, we need to be flexible.</b></i></p> ",
